rules.rule:
for all t in Integer : 
	annual(t+1) = annual(t) 
		 + beta_annual_area * area'(t)
		 + beta_annual_crop_technology * crop_technology'(t)
		 + annual'(t);

for all t in Integer : 
	area(t+1) = area(t) 
		 + area'(t);

for all t in Integer : 
	crop_technology(t+1) = crop_technology(t) 
		 + beta_crop_technology_food_security * food_security'(t)
		 + crop_technology'(t);

for all t in Integer : 
	intervention(t+1) = intervention(t) 
		 + beta_intervention_food_security * food_security'(t)
		 + intervention'(t);

for all t in Integer : 
	food_security(t+1) = food_security(t) 
		 + beta_food_security_intervention * intervention'(t)
		 + beta_food_security_livelihood * livelihood'(t)
		 + beta_food_security_market * market'(t)
		 + food_security'(t);

for all t in Integer : 
	livelihood(t+1) = livelihood(t) 
		 + beta_livelihood_technology * technology'(t)
		 + livelihood'(t);

for all t in Integer : 
	technology(t+1) = technology(t) 
		 + technology'(t);

for all t in Integer : 
	crop_season(t+1) = crop_season(t) 
		 + beta_crop_season_livelihood * livelihood'(t)
		 + crop_season'(t);

for all t in Integer : 
	economy(t+1) = economy(t) 
		 + beta_economy_food_security * food_security'(t)
		 + economy'(t);

for all t in Integer : 
	market(t+1) = market(t) 
		 + beta_market_food_security * food_security'(t)
		 + market'(t);

for all t in Integer : 
	flora(t+1) = flora(t) 
		 + flora'(t);

for all t in Integer : 
	price(t+1) = price(t) 
		 + price'(t);

for all t in Integer : 
	weight(t+1) = weight(t) 
		 + weight'(t);

for all t in Integer : 
	precipitation(t+1) = precipitation(t) 
		 + beta_precipitation_annual * annual'(t)
		 + beta_precipitation_flooding * flooding'(t)
		 + precipitation'(t);

for all t in Integer : 
	flooding(t+1) = flooding(t) 
		 + flooding'(t);

for all t in Integer : 
	communities(t+1) = communities(t) 
		 + communities'(t);

for all t in Integer : 
	crop(t+1) = crop(t) 
		 + beta_crop_market * market'(t)
		 + crop'(t);
